2	eat-local-lunch	Eat locally grown food for lunch	Less energy is used for transportation when only locally grown food is consumed	The food we eat comes from all over the world. How much CO2 this emits depends on your specific location and menu. On average, a person in the USA can save 1,400 pounds of CO2 per year by switching to locally grown food. We assume that one lunch is equivalent of 1.5 pounds of CO2 saved.	http://www.huffingtonpost.com/bill-chameides/carbon-savings-at-home_b_113551.html	1.50	15	f	Locally grown food often contains less preservatives and is fresher, making it a healthier and tastier choice. 	1	f	1	lighterprints/activity-icons/80-shopping-cart_1.png	\N	0	0	0	\N	2012-05-15 13:01:39.756477-07	2012-05-15 13:01:39.756487-07	t
1	enable-sleep-on-computer	Enable sleep function on your computer	Your computer consumes less energy when it's asleep or turned off	Annual energy savings from enabling the sleep feature on a computer and monitor = 235 kWh.\r\nSavings assumes a weighted average of consumer behavior rather than assuming computers are turned off all night, as well as that the computer and monitor are ENERGY STAR rated. 	http://www.epa.gov/climatechange/kids/calc/index.html	0.98	10	t	Using the sleep function can save money on your electric bill. It also can reduce the heat produced by your computer, which may improve its lifetime. 	1	f	1	lighterprints/activity-icons/69-display_1.png	\N	0	0	0	\N	2012-05-15 13:01:39.758375-07	2012-05-15 13:01:39.758385-07	t
3	share-your-ride	Share your ride	Carpooling is more energy efficient than travelling alone in your car.	We assume a car averaging 22.4 miles per gallon. CO2 emissions are 19.53 pounds per gallon and 1.5 pounds per gallon of non-CO2 CO2 equivalent emissions. This means 0.94 pounds per mile. We assume a trip length of 5 miles.\r\n\r\nIf there are N carpoolers, the savings are (N-1) / N* 4.7. Hence for N=2 persons, the savings are 2.85 pounds. More carpoolers lead to more reductions.	http://www.epa.gov/climatechange/kids/calc/index.html	9.40	94	f	\N	1	f	1	lighterprints/activity-icons/81-dashboard_1.png	\N	0	0	0	\N	2012-05-15 13:01:39.762375-07	2012-05-15 13:01:39.762384-07	t
6	water-off-while-brushing-teeth	Turn water off while brushing your teeth	Don't leave the water running while you're brushing your teeth	Turning off the water while brushing saves 0.5 kWh per person per day. This assumes four minutes a day spent brushing (enough to account for brushing teeth twice daily) and typical energy use for water supply, treatment, and heating. With 1.52 CO2 per kWh this leads to a savings of 0.76 pounds of CO2 a day.	http://www.epa.gov/climatechange/kids/calc/index.html	0.76	8	f	\N	2	f	1	lighterprints/activity-icons/186-toothbrush_1.png	\N	0	0	0	\N	2012-05-15 13:01:39.766506-07	2012-05-15 13:01:39.766516-07	f
9	no-beef	Replace beef with poultry	Beef production is very energy intensive	Replacing the protein you get from beef with poultry can save you 1,555 pounds of CO2 emissions annually. Per day, this switch leads to 4.26 pounds of CO2 savings.	http://www.simplesteps.org/food/shopping-wise/co2-smackdown-step-6-trimming-out-beef-and-pork	4.26	43	f	\N	2	f	1	lighterprints/activity-icons/109-chicken_1.png	\N	0	0	0	\N	2012-05-15 13:01:39.770481-07	2012-05-15 13:01:39.77049-07	t
8	recycle-paper	Recycle paper	Saving paper resources and production by recycling	The average number of pounds of CO2 equivalent per person per year that could be saved by recycling paper is 14.86 pounds for magazines, 89.76 pounds for newspapers, and 100 pounds for junk mail. These add up to 0.56 pounds per day.	http://www.epa.gov/climatechange/kids/calc/index.html	0.56	6	t	\N	2	f	1	lighterprints/activity-icons/166-newspaper_1.png	\N	0	0	0	\N	2012-05-15 13:01:39.772341-07	2012-05-15 13:01:39.772351-07	t
5	recycle-materials	Recycle materials	Recycling processes used materials into new products to prevent waste of potentially useful materials.	The average number of pounds of CO2 equivalent per person per year that could be saved by recycling is 6.83 pounds for glass, 18.96 pounds for plastic, and 86.05 pounds for aluminum and steel cans. This is an average of 2.15 pounds a week, or .31 pounds a day.	http://www.epa.gov/climatechange/kids/calc/index.html	0.31	3	t	\N	1	f	1	lighterprints/activity-icons/51-recycle.png	8	0	0	0	\N	2012-05-15 13:01:39.760348-07	2012-05-15 13:01:39.760358-07	t
14	air-dry-clothes	Air dry your clothes	Air drying your clothes saves gas or electricity	Air drying your clothes saves 723 pounds of CO2 every year, or 1.98 pounds per day.	http://www.simplesteps.org/tools/house-savings-calculator#laundry	1.98	20	f	\N	3	f	1	lighterprints/activity-icons/67-tshirt_1.png	15	0	0	0	\N	2012-05-15 13:01:39.774218-07	2012-05-15 13:01:39.774228-07	t
10	bike-or-walk	Bike, walk, or take public transportation when you go out	Reduce fossil fuel consumption and emissions by not driving a car	We assume a car averaging 22.4 miles per gallon and a trip length of 4 miles. CO2 emissions are 19.53 pounds per gallon and 1.5 pounds per gallon of non-CO2 CO2 equivalent emissions. This means 0.94 pounds per mile. 	http://www.epa.gov/climatechange/kids/calc/index.html	7.52	75	f	\N	2	f	1	lighterprints/activity-icons/47-bicycle-to.png	3	0	0	0	\N	2012-05-15 13:01:39.764584-07	2012-05-15 13:01:39.764593-07	t
13	eat-green-lunch	Eat a green lunch	Reduce the amount of waste you produce at lunch time.	You can save 500 pounds of CO2 a year by reducing waste at lunch time. This means packing your lunch in a reusable container, using reusable/washable utensils, and dont use paper napkins.	http://www.savecarbon.org/activity_form/lunches	1.37	14	f	You can save money by buying reusable containers and utensils once instead of buying disposable items regularly. 	3	f	1	lighterprints/activity-icons/48-fork-and-knife_1.png	2	0	0	0	\N	2012-05-15 13:01:39.776085-07	2012-05-15 13:01:39.776095-07	t
11	lights-off	Turn off unnecessary lights	Turning lights off in areas that don't need them saves energy.	The amount of CO2 saved by turning lights off is [60 watts / 1000 watts/kWh] * 1.52 pounds of CO2 per kWh, which equals 0.09 pounds of CO2 per bulb per hour. Assuming 5 bulbs are turned off for 5 hours, this saves 2.28 pounds of CO2 per day.	http://www.epa.gov/climatechange/kids/calc/index.html	2.28	23	f	Turning lights off can save you money on your electric bill. Since lights give off heat, turning them off can also help keep rooms cooler. 	3	f	1	lighterprints/activity-icons/84-lightbulb_1.png	4	0	0	0	\N	2012-05-15 13:01:39.77796-07	2012-05-15 13:01:39.777969-07	t
12	vegan-for-a-day	Eat a vegan breakfast	Raising animals for meat is resource intensive	A plant-based diet saves 1,608 pounds of CO2 per year compared to the average diet.	http://www.simplesteps.org/tools/house-savings-calculator#diet	4.41	44	f		3	f	1	lighterprints/activity-icons/125-food_1.png	9	0	0	0	\N	2012-05-15 13:01:39-07	2012-05-15 13:01:39-07	t
7	computer-off-night	Turn off your computer at night	Save energy and turn off your computer when it's not needed.	The average computer uses about 120 Watts (75 Watts for the screen and 45 Watts for the CPU) whether you're using it or not.\r\nOne computer left on 24 hours a day will cause 1,500 pounds of CO2 to be emitted into the atmosphere.	http://sustainability.tufts.edu/	1.37	14	f	\N	2	f	1	lighterprints/activity-icons/126-moon_1.png	1	0	0	0	\N	2012-05-15 13:01:39.768422-07	2012-05-15 13:01:39.768431-07	t
4	adjust-thermostat	Adjust your thermostat by 2 degrees	Heating or cooling buildings less saves energy	Climate-controlled buildings cost a lot of energy. Adjusting the temperature by two degrees saves 2,000 pounds of CO2 a year.	http://earthcareindiana.org/node/131	5.50	55	f	Less energy used results in savings on an electric bill. 	1	f	1	lighterprints/activity-icons/93-thermometer_1.png	\N	0	0	0	1	2012-05-15 13:01:39-07	2012-05-15 13:01:39-07	t
